script: |
  super -f text -I q5955.spq | sort > q5955.out

inputs:
  - name: q5955.spq
    data: |
      SELECT ALL + col0 / 87 + + 22 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col2 * + col0 + + + ( - col0 ) * + + col0 NOT BETWEEN - col2 AND CAST ( + col1 AS REAL );
  - name: tab0

outputs:
  - name: q5955.out
    data: |
